extern crate bitcoin;
use bitcoin::{
    hashes::hex::{FromHex, ToHex},
    Transaction, Block
};

fn main() {
    let segwit_tx_hex = "02000000000801f0e3f3ee06603dec65d593a4efede7da81dcf999d4c07a5e11f51fe526ce544e0000000000ffffffff01a6437307000000002258202d19998ab39025280552c7d88725c9c212587091502dcfadc98ac41e15009f6b0000000000";
    let bytes: Vec<u8> = FromHex::from_hex(&segwit_tx_hex).unwrap();
    let tx: Result<Transaction, bitcoin::consensus::encode::Error> =
        bitcoin::consensus::deserialize(&bytes);
    dbg!(tx.unwrap().txid());

    let block_with_segwit_tx = "";
    let block_bytes: Vec<u8> = FromHex::from_hex(&block_with_segwit_tx).unwrap();
    let block: Result<Block, bitcoin::consensus::encode::Error> = bitcoin::consensus::deserialize(&block_bytes);
    dbg!(block);
}
